import React from 'react';

import Dashboard from '../../pages/Dashboard/Dashboard';

import './Error.css';

const Error = () => {
	return (
		<Dashboard>
			<div className="error">
				<h1>404</h1>
				<h2>Page not found</h2>
			</div>
		</Dashboard>
	);
};

export default Error;
